//CSS
var HXDialogAreaCSS = '<style type="text/css">' +
    '#HXDialogArea{display:none;margin:0;padding:0;background:#FFFFFF;border:1px solid #CECBCE;box-shadow:0 0 5px #DDDDDD;padding:10px;width:390px;z-index:9999;font-size:12px;}' +
    '#HXDialogAreaClose{width:68px;height:20px;position:absolute;top:15px;right:0;}' +
    '#HXDialogAreaClose span{padding-left:5px;color:#357BC3;text-decoration:none;cursor:pointer;}' +
    '#HXDialogAreaClose span:hover{color:red;}' +
    '.HXDialogAreaTab {margin:0;padding:0;}' +
    '.HXDialogAreaTab .tab{margin:0;padding:0;border-bottom: 2px solid #EDD28B;height:25px;overflow: visible;width: 100%;}' +
    '.HXDialogAreaTab .tab li{margin:0;padding:0;text-align:center;overflow:hidden;float: left;list-style:none;}' +
    '.HXDialogAreaTab .tab a{border-color:#DDDDDD;border-style:solid solid none;border-width:1px 1px 0;color:#005AA0;float:left;height:25px;line-height:25px;margin-right:3px;padding:0 10px;text-decoration:none;}' +
    '.HXDialogAreaTab .tab a.hover{background-color:#FFFFFF;border-color: #EDD28B;border-style:solid solid none;border-width:2px 2px 0;color:#000000;}' +
    '.area-list {margin: 0;padding: 0;padding-top: 5px;}' +
    '.area-list li {float:left;padding:2px 0 2px 15px;width:60px;height:17px;line-height:17px;overflow:hidden;list-style:none;}' +
    '.area-list li a{color:#005AA0;text-decoration:none;}' +
    '.area-list li a:hover{background:#005ea7;color:#fff}' +
    '</style>';
