var HXDialogAreaTPL =	'<div id="HXDialogAreaClose"></div>' +
    '<div class="HXDialogAreaTab"><ul class="tab" id="HXDialogAreaTabUl"></ul></div>' +
    '<div id="HXDialogAreaPL" style="display:block;"><ul class="area-list" id="HXDialogAreaPLUl"></ul></div>' +
    '<div id="HXDialogAreaCL" style="display:none;"><ul class="area-list" id="HXDialogAreaCLUl"></ul></div>' +
    '<div id="HXDialogAreaAL" style="display:none;"><ul class="area-list" id="HXDialogAreaALUl"></ul></div>';
var HXDialogArea = function (options){this.init(options);};
HXDialogArea.prototype = {
    $ : function(id){
        return document.getElementById(id);
    },
    _addEvent : function(el, evname, func) {
        if (el.attachEvent) { // IE
            el.attachEvent("on" + evname, func);
        } else if (el.addEventListener) { // Gecko / W3C
            el.addEventListener(evname, func, true);
        } else {
            el["on" + evname] = func;
        }
    },
    _removeEvent : function(el, evname, func) {
        if (el.detachEvent) { // IE
            el.detachEvent("on" + evname, func);
        } else if (el.removeEventListener) { // Gecko / W3C
            el.removeEventListener(evname, func, true);
        } else {
            el["on" + evname] = null;
        }
    },
    _createElement : function(type, parent) {
        var el = null;
        if (document.createElementNS) {
            // use the XHTML namespace; IE won't normally get here unless  _they_ "fix" the DOM2 implementation.
            el = document.createElementNS("http://www.w3.org/1999/xhtml", type);
        } else {
            el = document.createElement(type);
        }
        if (typeof parent != "undefined") {
            parent.appendChild(el);
        }
        return el;
    },
    _setCookie : function(name,value,expiredays){
        var exdate=new Date(); exdate.setTime(exdate.getTime() + expiredays*24*60*60*1000);
        document.cookie= name + "="  + escape(value) + ";domain=houxue.com" +((expiredays==null) ? "" : ";expires="+exdate.toGMTString())+";path=/";
    },
    _param_default : function(options,pname, def){
        if(typeof this.options[pname] == "undefined") this.options[pname] = def; return this;
    },
    init : function(options) {
        this.options = options;
        this._param_default(this.options,'divId','HXDialogArea');
        this._param_default(this.options,'inputField',null);
        this._param_default(this.options,'displayField',null);
        this._param_default(this.options,'displayPosition','Right Bottom');
        this._param_default(this.options,'onClose', null);
        this._param_default(this.options,'level',2);

        this.OBJIF = this.$(this.options.inputField);
        this.OBJDF = this.$(this.options.displayField);

        var _this = this;
        this._addEvent(this.OBJDF, "click", function(e){_this.open();} );
        HXDialogAreaCount++;

        this._addEvent(document.body,"click",function(e){
            var obj=e.srcElement?e.srcElement:e.target;
            var flag=false;
            while(obj.tagName.toUpperCase() != 'BODY'){
                if('HXDialogArea' == obj.id || _this.options.displayField == obj.id) {flag=true;break;}
                obj=obj.parentNode;
            }
            if(!flag)	_this.close();
        });

        this._addEvent(document.body,"keydown",function(e){_this.onKeydown(e)});

        return this;
    },

    onKeydown : function(e){
        if(27==e.keyCode)	this.close();
    },

    open : function(){
        if(this.$('HXDialogCate')) this.$('HXDialogCate').style.display = 'none';
        this.Div = this.$(this.options.divId);
        if(!this.Div) {
            this.Div = this._createElement('div',document.body); this.Div.id = this.options.divId; this.Div.style.position = 'absolute'; this.Div.innerHTML = HXDialogAreaTPL;
        }

        var obj = this.OBJDF,t = obj.offsetTop,l = obj.offsetLeft;
        while (obj = obj.offsetParent) {//
            t += obj.offsetTop;			//
            l += obj.offsetLeft;		//
        }
        var Px = this.options.displayPosition.split(' ')[0];
        this.Div.style.left = Px=="Center" ? (l - 410/2) + 'px' : ( Px=="Left" ?  (l - 410) + 'px' : l + 'px' );
        var Py = this.options.displayPosition.split(' ')[1];
        this.Div.style.top = Py=="Center" ? (t + this.OBJDF.offsetHeight - 200/2) + 'px' : ( Py=="Left" ?  (t + this.OBJDF.offsetHeight - 200) + 'px' : (t + this.OBJDF.offsetHeight) + 'px' );
        this.Div.style.display = 'block';

        this.CLOSE = this.$('HXDialogAreaClose');
        this.OBJTUL = this.$('HXDialogAreaTabUl'); this.OBJPL = this.$('HXDialogAreaPL');
        this.OBJPLUL = this.$('HXDialogAreaPLUl'); this.OBJCL = this.$('HXDialogAreaCL');
        this.OBJCLUL = this.$('HXDialogAreaCLUl');
        this.OBJAL = this.$('HXDialogAreaAL'); this.OBJALUL = this.$('HXDialogAreaALUl');

        this.TABLIST = new Array;
        this.TABLIST[0]='';this.TABLIST[1]='';this.TABLIST[2]='';	this.renderTab(0);

        var _this = this;
        //
        this.CLOSE.innerHTML = '';
        var el = this._createElement('span',this.CLOSE); el.innerHTML= ''; this._addEvent(el, "click", function(){_this.clear();} );
        var el = this._createElement('span',this.CLOSE); el.innerHTML= ''; this._addEvent(el, "click", function(){_this.close();} );

        this.OBJPLUL.innerHTML = '';
        var el = this._createElement('li',this.OBJPLUL); el.innerHTML= '<a href="javascript:;"></a>'; this._addEvent(el, "click", function(){_this.finalSel(0);} );
        for(var k in HXDialogAreaPLIST){
            var d= HXDialogAreaPLIST[k];
            var el = this._createElement('li',this.OBJPLUL); el.innerHTML= '<a href="javascript:;" title="'+ d[1] +'"><span style="color:red;">'+  d[2] + '</span> ' + d[1] +'</a>';
            (function(k){		_this._addEvent(el, "click", function(){_this.selP(k);} );			})(k);
        }
        return this;
    },
    close : function(){
        if(this.Div!=undefined)
        {
            if(this.Div.style.display!='none')
            {
                var fn = this.options.onClose;
                typeof fn !== 'function' || fn.call(this) !== false ? '' : this;
            }
            this.Div.style.display = 'none';
        }
        return this;
    },
    clear : function(){
        if(this.OBJDF.type) this.OBJDF.value = ''; else this.OBJDF.innerHTML = ''; this.OBJIF.value=""; this.close(); this._setCookie('houxue_aid',0); return this;
    },
    renderTab : function(x){
        var _this = this;
        this.OBJTUL.innerHTML = '';
        for(var k = 0,len = this.TABLIST.length; k < len; ++k){
            //for(var k in this.TABLIST){
            if(this.TABLIST[k]!='') {
                var el = this._createElement('li',this.OBJTUL); el.innerHTML= '<a  class="'+ (x==k ? "hover" : "") +'" href="javascript:;">'+ this.TABLIST[k] +'</a>';
                (function(k){		_this._addEvent(el, "click", function(){_this.renderTab(k);} );			})(k);
            }
            //if(this.TABLIST[k]!='') {
            //    console.log(this.TABLIST[k]);
            //    (function(content,k){
            //        var el = _this._createElement('li',this.OBJTUL); el.innerHTML= '<a class="'+ (x==k ? "hover" : "") +'" href="javascript:;">'+ content +'</a>';
            //        _this._addEvent(el, "click", function(){_this.renderTab(k);} );
            //    })(this.TABLIST[k],k);
            //}
        }
        if(x==0) this.OBJPL.style.display = ''; else this.OBJPL.style.display = 'none';
        if(x==1) this.OBJCL.style.display = ''; else this.OBJCL.style.display = 'none';
        if(x==2) this.OBJAL.style.display = ''; else this.OBJAL.style.display = 'none';
        return this;
    },
    selP : function(k0){
        var a1 = HXDialogAreaPLIST[k0];
        this.TABLIST[0]=a1[1];this.TABLIST[1]='';this.TABLIST[2]='';	this.renderTab(1);
        if(this.options.level==0) this.finalSel(a1[0]);

        var _this = this;
        this.OBJCLUL.innerHTML = '';
        var el = this._createElement('li',this.OBJCLUL); el.innerHTML= '<a href="javascript:;">'+ a1[1] +'</a></li>'; this._addEvent(el, "click", function(){_this.finalSel(a1[0]);} );
        for(var k in HXDialogAreaCLIST[a1[0]]){
            var d= HXDialogAreaCLIST[a1[0]][k];
            var el = this._createElement('li',this.OBJCLUL); el.innerHTML= '<a href="javascript:;" title="'+ d[1] +'"><span style="color:red;">'+  d[2] + '</span> ' + d[1] +'</a>';
            (function(k){		_this._addEvent(el, "click", function(){_this.selC(k0,k);} );			})(k);
        }
        this.OBJCL.style.display = '';
        this.renderOBJDF(a1[0]);
        return this;
    },
    selC : function(k0,k1){
        var a1 = HXDialogAreaPLIST[k0];var a2 = HXDialogAreaCLIST[a1[0]][k1];
        this.TABLIST[0]=a1[1];this.TABLIST[1]=a2[1];this.TABLIST[2]='';	this.renderTab(2);
        if(this.options.level==1) this.finalSel(a2[0]);

        var _this = this;
        this.OBJALUL.innerHTML = '';
        var el = this._createElement('li',this.OBJALUL); el.innerHTML= '<a href="javascript:;">'+ a2[1] +'</a>'; this._addEvent(el, "click", function(){_this.finalSel(a2[0]);} );
        for(var k in HXDialogAreaALIST[a2[0]]){
            var d= HXDialogAreaALIST[a2[0]][k];
            var el = this._createElement('li',this.OBJALUL); el.innerHTML= '<a href="javascript:;" title="'+ d[1] +'"><span style="color:red;">'+  d[2] + '</span> ' + d[1] +'</a>';
            (function(k){		_this._addEvent(el, "click", function(){_this.selA(k0,k1,k);} );			})(k);
        }
        this.OBJAL.style.display = '';
        this.renderOBJDF(a2[0]);
        return this;
    },
    selA : function(k0,k1,k2){
        var a1 = HXDialogAreaPLIST[k0];var a2 = HXDialogAreaCLIST[a1[0]][k1];var a3 = HXDialogAreaALIST[a2[0]][k2];
        this.TABLIST[0]=a1[1];this.TABLIST[1]=a2[1];this.TABLIST[2]=a3[1];	this.renderTab(3);
        if(this.options.level==2) this.finalSel(a3[0]);
        return this;
    },
    finalSel : function(aid){
        this.renderOBJDF(aid); this.close(); return this;
    },
    renderOBJDF : function(aid){
        var html ='';
        /*for(var k in this.TABLIST)*/for(var k = 0,len = this.TABLIST.length; k < len; ++k){if(this.TABLIST[k]!='' && this.TABLIST[k]!='') html += this.TABLIST[k] + "-"; }
        if(this.OBJDF.type) this.OBJDF.value = html.substr(0,html.length-1); else this.OBJDF.innerHTML = html.substr(0,html.length-1);
        this.OBJIF.value = aid;
        this._setCookie('houxue_aid',aid);
        return this;
    }
};
